import React from 'react';
import { Link } from 'react-router-dom'

const NavBar = () => {
    return ( 
        <div className="linksGroup">
        <button className="link-button"><Link to='Home'>Home</Link></button>
        <button className="link-button"><Link to='About'>About</Link></button>
        <button className="link-button"><Link to='MyBooks'>MyBooks</Link></button>
        <button className="link-button"><Link to='MyAlerts'>MyAlerts</Link></button>
        <button className="link-button"><Link to='MyFriendsBooks'>MyFriendsBooks</Link></button>
        <div className="animation start-home"></div>
    </div>
     );
}

export default NavBar;
